import React, { Component } from "react";

class Todos extends Component {
  render() {
    //console.log(this.props.todos);
    const todos = this.props.todos;
    return (
      <div>
        {todos.map((todo) => {
          return <div>{todo.title}</div>;
        })}
      </div>
    );
  }
}

export default Todos;
